/* SPDX-License-Identifier: MIT */
pragma solidity =0.8.10;

/* Package Imports */
import {PRBMathUD60x18} from "@hifi-finance/prb-math/contracts/PRBMathUD60x18.sol";
import {SafeERC20} from "@openzeppelin/contracts/token/ERC20/utils/SafeERC20.sol";

/* Package Interface Imports */
import {IERC20} from "@openzeppelin/contracts/token/ERC20/IERC20.sol";

/* Internal Imports */
import {PhantomStorageMixin} from "../../mixins/PhantomStorageMixin.sol";

/* Internal Interface Imports */
import {IPhantomStaking} from "../../../interfaces/level0/staking/IPhantomStaking.sol";
import {IPhantomStakingWarmup} from "../../../interfaces/level0/staking/IPhantomStakingWarmup.sol";

/**
 * @title PhantomStaking
 * @author 0xrebased @ Bonga Bera Capital: https://github.com/BongaBeraCapital
 * @notice The contract that handles staking sPHM
 */
contract PhantomStaking is PhantomStorageMixin, IPhantomStaking {
    using PRBMathUD60x18 for uint256;
    using SafeERC20 for IERC20;

    constructor(address storageFactoryAddress) PhantomStorageMixin(storageFactoryAddress) {
        return;
    }

    //=================================================================================================================
    // External Functionss
    //=================================================================================================================

    function initializeRebasing() external onlyRegisteredContracts {
        // Set rebase state
        PhantomStorage().setUint(
            keccak256(abi.encodePacked(phantom.staking.rebaseCounter)), 
            1
        );
        PhantomStorage().setUint(
            keccak256(abi.encodePacked(phantom.staking.nextRebaseDeadline)), 
            block.timestamp + sPHM().secondsPerCompoundingPeriod()
        );
    }

    function stake(
        address inStaker,
        uint256 inAmount
    ) external override onlyRegisteredContracts nonReentrant {
        attemptRebase();
        PhantomStakingWarmup().beginVesting(inStaker, inAmount);
        // Burn the OHM and mint sOHM
        PhantomTreasury().swapBurnMint(
            inStaker,
            inAmount,
            address(PHM()),
            inAmount,
            address(sPHM()),
            reserveKey(),
            percentage100()
        );
    }

    function unstake(
        address inUnstaker,
        uint256 inAmount
    ) external override onlyRegisteredContracts nonReentrant {
        attemptRebase();
        uint256 amountToUnstake = PhantomStakingWarmup().copyVestedAmount(inUnstaker, inAmount);
        // Burn the sPHM and mint PHM
        PhantomTreasury().swapBurnMint(
            inUnstaker,
            inAmount,
            address(sPHM()),
            amountToUnstake,
            address(PHM()),
            reserveKey(),
            percentage100()
        );
    }

    /**
     * @notice convert _amount of sPHM into gPHM
     * @param toUser address who is to own the gPHM?
     * @param amount uint how much sPHM to wrap
     * @return gBalance uint amount of gPHM minted
     */
    function wrap(
        address toUser, 
        uint256 amount
    ) external override onlyRegisteredContracts nonReentrant returns (uint256 gBalance) {
        // Burn the sPHM and mint gPHM
        PhantomTreasury().swapBurnMint(
            toUser,
            amount,
            address(sPHM()),
            gPHM().balanceFromPHM(amount),
            address(gPHM()),
            reserveKey(),
            percentage100()
        );
    }

    /**
     * @notice convert amount of gPHM into sPHM
     * @param toUser address who is to own the sPHM?
     * @param amount uint how much gPHM to unwrap
     * @return sBalance uint amount of sPHM transfered
     */
    function unwrap(
        address toUser, 
        uint256 amount
    ) external override onlyRegisteredContracts nonReentrant returns (uint256 sBalance) {
        // Burn the gPHM and mint sPHM
        PhantomTreasury().swapBurnMint(
            toUser,
            amount,
            address(gPHM()),
            gPHM().balanceToPHM(amount),
            address(sPHM()),
            reserveKey(),
            percentage100()
        );
    }

    /**
     * @dev Trigger a rebase if it's time to do so.
     */
    function attemptRebase() public returns (uint256) {
        uint256 nextRebaseDeadline = PhantomStorage().getUint(keccak256(
            abi.encodePacked(phantom.staking.nextRebaseDeadline))
        );

        if (nextRebaseDeadline <= block.timestamp) {
            uint256 rebaseCounter = PhantomStorage().getUint( keccak256(
                abi.encodePacked(phantom.staking.rebaseCounter))
            );

            // Do the rebase
            sPHM().doRebase(rebaseCounter);

            // Set state for next rebase
            PhantomStorage().addUint(keccak256(
                abi.encodePacked(phantom.staking.rebaseCounter)), 
                1
            );
            PhantomStorage().setUint(keccak256(
                abi.encodePacked(phantom.staking.nextRebaseDeadline)), 
                nextRebaseDeadline + sPHM().secondsPerCompoundingPeriod()
            );
        }
    }

    //=================================================================================================================
    // Interface Referances
    //=================================================================================================================

    function PhantomStakingWarmup() internal view returns (IPhantomStakingWarmup) {
        return IPhantomStakingWarmup(PhantomStorage().getAddress(keccak256(phantom.contracts.stakingwarmup)));
    }
}
